package com.vandersoncamp.transporte.dto;import com.vandersoncamp.transporte.model.Cliente;import com.vandersoncamp.transporte.model.LinhaLotacao;import com.vandersoncamp.transporte.model.LinhaOnibus;import java.util.List;public class ClienteLinhaDTO {    private Cliente cliente;    private List<LinhaOnibus> linhasOnibus;    private List<LinhaLotacao> linhasLotacoes;    public Cliente getCliente() {        return cliente;    }    public void setCliente(Cliente cliente) {        this.cliente = cliente;    }    public List<LinhaOnibus> getLinhasOnibus() {        return linhasOnibus;    }    public List<LinhaLotacao> getLinhasLotacoes() {        return linhasLotacoes;    }    public void setLinhasOnibus(List<LinhaOnibus> linhasOnibus) {        this.linhasOnibus = linhasOnibus;    }    public void setLinhasLotacoes(List<LinhaLotacao> linhasLotacoes) {        this.linhasLotacoes = linhasLotacoes;    }}